(75, 'DCAC001', 'DC16KW', 'Smart Card', 'Public', 'The Aadhaar Smart Card is a physical card that contains an individual\'s Aadhaar details in a chip format. It serves as a convenient way to carry and present your Aadhaar information when required, without having to carry your original Aadhaar card. The card is available to anyone who has an Aadhaar number and can be ordered online through the UIDAI website or from authorized centers.', 150, '50', 0, NULL, 'Thumbnails/Services/Smart Card/SS_Smart Card_1683385058.jpg', 'No', '2023-06-03 05:16:47', '2022-08-11 18:18:55'),
(77, 'DCAC001', 'DC32MYA', 'Gender Corrrection', 'Public', 'Gender Declaration in Aadhar is very Curial Field, as it declares the identity of  an idividual', 250, '50', 1, NULL, 'Thumbnails/Services/Gender Corrrection/SS_Gender Corrrection_1685672372.jpg', 'No', '2023-06-03 05:16:48', '2023-06-02 04:49:32'),
(71, 'DC81PFL', 'DC41UXQ', 'New Applicaiton', 'Public', 'As a part of decentralisation through the Indian Constitutional Amendment Act 1993, the implementation of Widow Pension, which were handled by the Soc', 200, NULL, 0, NULL, NULL, 'No', '2021-10-03 00:10:22', '2021-10-03 00:10:22'),
(1, 'DCAC001', 'DCAC01', 'Name Correction', 'Public', 'Correcting your name in documents is an essential task that should not be taken lightly. Whether you\'ve recently changed your name due to marriage, divorce, or personal reasons, or your name has been misspelled or incorrectly recorded in official documents, it\'s important to take the necessary steps to ensure that your name is accurately reflected in all your important paperwork.', 200, '50', 32, 0, 'Thumbnails/Services/Name Correction/SS_Name Correction_1683384363.png', 'No', '2023-06-03 05:16:48', '2021-09-30 09:19:19'),
(2, 'DCAC001', 'DCAC02', 'DOB Correction', 'Public', 'Correcting your date of birth in documents is an important task that should not be ignored. Whether your date of birth was recorded incorrectly, or you need to update it due to legal or personal reasons, \n\nIt can result in delays or rejections in processing important applications, including passport and visa applications,', 250, '50', 29, 0, 'Thumbnails/Services/DOB Correction/SS_DOB Correction_1683384528.png', 'No', '2023-06-03 05:16:48', '2021-09-30 09:19:19'),
(4, 'DCAC001', 'DCAC04', 'Father Name', 'Public', 'Correcting your father\'s name in Aadhaar, India\'s national identity card, is important for several reasons. Your Aadhaar card is a vital document that serves as proof of identity and is required for various government and private transactions. Any incorrect information on your Aadhaar card, including your father\'s name, can cause problems and delays in these transactions.', 250, '50', 0, 0, 'Thumbnails/Services/Father Name/SS_Father Name_1683384785.png', 'No', '2023-06-03 05:16:48', '2021-09-30 09:19:19'),
(5, 'DCAC001', 'DCAC05', 'Address Correction', 'Public', 'Correcting your address in official documents is crucial for several reasons. Your address is an essential piece of information used to verify your identity and determine your eligibility for various government and private services. Any incorrect information on your address can cause problems and delays in these transactions.', 300, '50', 321, 0, 'Thumbnails/Services/Address Correction/SS_Address Correction_1683384900.png', 'No', '2023-06-03 05:16:48', '2021-09-30 09:19:19'),
(6, 'DCAP006', 'DCAP01', 'House Rental Agreement', 'Public', 'Rental Agreement playes an imortant role in avoiding the litigation with landlords at the time of vaccating the premises and collecting the refund of security deposit.', 200, '30', 83, 0, 'Thumbnails/Services/House Rental Agreement/SS_House Rental Agreement_1685673315.png', 'No', '2021-09-30 09:19:19', '2021-09-30 09:19:19'),
